const TestimonialThumbnail = ({ imgURL, handleImageChange, label }) => {
    
    function handleImageChange() {
        setFirstImage(imgURL);
    };

    return (
        <li className="w-16 h-20 my-5 mr-8 cursor-pointer relative" onChange={handleImageChange}>
            <img src={imgURL} alt={label}/>
        </li>
    );
};

export default TestimonialThumbnail;
